            java.io.InputStream inContext = DailyTimeKeepingJob.class.getClassLoader().getResourceAsStream("ovirt_engine_dwh/dailytimekeepingjob_4_5/contexts/" + contextStr + ".properties");
            if (inContext == null) {
                inContext = DailyTimeKeepingJob.class.getClassLoader().getResourceAsStream("config/contexts/" + contextStr + ".properties");
            }
